"use strict";class simpleFETCH{async get(t){const a=await fetch(t);return await a.json()}async post(t,a){const e=await fetch(t,{method:"POST",headers:{"Content-type":"application/json"},body:JSON.stringify(a)});return await e.json()}async put(t,a){const e=await fetch(t,{method:"PUT",headers:{"Content-type":"application/json"},body:JSON.stringify(a)});return await e.json()}async delete(t){await fetch(t,{method:"DELETE",headers:{"Content-type":"application/json"}});return await"Data Deleted"}}
